import React from 'react';
import * as S from './styled';


export const Repositories = () => {
  return( 
    <S.WrapperTabs
    //faz ser exibida qual tab foi clicada Repositories || Starred; 
      selectedTabClassName='is-selected'
      // selectedTabPanelClassName='is-selected'
    >
      <S.WrapperTabList>
        <S.WrapperTab>
          Repositories
        </S.WrapperTab>
        <S.WrapperTab>
          Starred
        </S.WrapperTab>
      </S.WrapperTabList>
      <S.WrapperTabPannel>Panel Repositories</S.WrapperTabPannel>
      <S.WrapperTabPannel>Panel Starred</S.WrapperTabPannel>
    </S.WrapperTabs>
  );
};
